import React, { useState } from 'react';
import { MapPin, Clock, Cloud, Send } from 'lucide-react';

const WeddingApp = () => {
  const [currentSection, setCurrentSection] = useState(0);

  const weddingDetails = {
    date: "24.05.2024",
    couple: {
      partner1: "Sarah",
      partner2: "Michael"
    },
    dressCode: {
      colors: ["#E5E5E5", "#D4C9C4", "#8B7355"],
      description: "Aesthetic Brown - Semi-formal attire"
    },
    location: {
      venue: "Black Dust Studio",
      address: "1234 Elegance Way"
    }
  };

  const Section = ({ children, bgColor = "bg-stone-50" }) => (
    <div className={`min-h-screen w-full flex flex-col items-center justify-center p-6 ${bgColor}`}>
      <div className="max-w-md w-full bg-white rounded-xl shadow-lg overflow-hidden">
        {children}
      </div>
    </div>
  );

  return (
    <div className="font-serif text-stone-800">
      {/* Header Section */}
      <Section>
        <div className="p-8 text-center space-y-6">
          <div className="mb-12 space-y-2">
            <p className="text-sm tracking-widest text-stone-500">SAVE THE DATE</p>
            <h1 className="text-4xl font-light tracking-wider">{weddingDetails.date}</h1>
          </div>
          
          <div className="relative mb-8">
            <img 
              src="/couple.jpg"
              alt="Couple" 
              className="rounded-t-full rounded-b-lg mx-auto"
              style={{
                maxWidth: '280px',
                width: '100%',
                height: 'auto'
              }}
            />
          </div>

          <div className="space-y-4">
            <h2 className="text-2xl tracking-wide">
              {weddingDetails.couple.partner1}
              <span className="block w-8 h-[1px] bg-stone-300 mx-auto my-4"></span>
              {weddingDetails.couple.partner2}
            </h2>
          </div>
        </div>
      </Section>

      {/* Dress Code Section */}
      <Section bgColor="bg-stone-100">
        <div className="p-8 text-center space-y-6">
          <h2 className="text-2xl tracking-widest mb-8">DRESS CODE</h2>
          <div className="flex justify-center space-x-4 mb-6">
            {weddingDetails.dressCode.colors.map((color, index) => (
              <div 
                key={index}
                className="w-12 h-12 rounded-full shadow-md"
                style={{ backgroundColor: color }}
              ></div>
            ))}
          </div>
          <p className="text-stone-600">{weddingDetails.dressCode.description}</p>
        </div>
      </Section>

      {/* Location Section */}
      <Section>
        <div className="p-8 text-center space-y-6">
          <h2 className="text-2xl tracking-widest mb-8">LOCATION</h2>
          <div className="space-y-4">
            <MapPin className="w-6 h-6 mx-auto text-stone-600" />
            <p className="font-medium">{weddingDetails.location.venue}</p>
            <p className="text-stone-600">{weddingDetails.location.address}</p>
          </div>
        </div>
      </Section>

      {/* Details Section */}
      <Section bgColor="bg-stone-200">
        <div className="p-8 text-center space-y-8">
          <h2 className="text-2xl tracking-widest mb-8">DETAILS</h2>
          
          <div className="space-y-8">
            <div>
              <h3 className="text-lg mb-4">CONTACTS</h3>
              <Send className="w-6 h-6 mx-auto text-stone-600 mb-2" />
              <p className="text-stone-600">Contact us via Telegram</p>
            </div>

            <div>
              <h3 className="text-lg mb-4">PHOTO</h3>
              <Cloud className="w-6 h-6 mx-auto text-stone-600 mb-2" />
              <p className="text-stone-600">Photos will be shared via cloud storage</p>
            </div>
          </div>
        </div>
      </Section>

      {/* Navigation Dots */}
      <div className="fixed right-4 top-1/2 transform -translate-y-1/2 space-y-2">
        {[0, 1, 2, 3].map((index) => (
          <button
            key={index}
            onClick={() => setCurrentSection(index)}
            className={`w-2 h-2 rounded-full transition-colors ${
              currentSection === index ? 'bg-stone-800' : 'bg-stone-400'
            }`}
          />
        ))}
      </div>
    </div>
  );
};

export default WeddingApp;
